def main1(s: str, k: int) -> int:
    ans = vowel = 0
    for i, c in enumerate(s):
        if c in "aeiou":
            vowel += 1
        left = i - k + 1  # 左端点

        if left < 0:  # 窗口大小不足k, 不能形成第一个窗口
            continue

        ans = max(ans, vowel)

        if s[left] in "aeiou":
            vowel -= 1

    return ans


def main1(s: str, k: int) -> int:
    ans = vowel = 0
    for i, c in enumerate(s):
        if c in "aeiou":
            vowel += 1
        # 窗口左端点
        left = i - k + 1  # [L,R] 里面元素的个数 R-L+1  如果窗口的大小为k，即 R-L+1=k, 可以推出L=R-k+1

        # 窗口大小不足k
        if left < 0:
            continue

        # 更新答案
        ans = max(ans, vowel)

        # 如果达到理论最大值  --- 优化
        if ans == k:
            break

        # 3. 左端点离开窗口
        if s[left] in "aeiou":
            vowel -= 1
    return ans


if __name__ == '__main__':
    print(main1("abciiidef", 3))
    print(main1("aeiou", 2))
    print(main1("leetcode", 3))
    print(main1("rhythms", 4))
    print(main1("tryhard", 4))
    print(main1(
        "",
        50436))
